dia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B8%D0%B7%D0%B5%D0%BB%D0%BE%D1%81,_%D0%AD%D0%BB%D0%B5%D1%84%D1%82%D0%B5%D1%80%D0%B8%D0%BE%D1%81\" title=\"\u0412\u0435\u043d\u0438\u0437\u0435\u043b\u043e\u0441, \u042d\u043b\u0435\u0444\u0442\u0435\u0440\u0438\u043e\u0441\">\u0412\u0435\u043d\u0438\u0437\u0435\u043b\u043e\u0441\u0430<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\">\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC\" title=\"\u041a\u0440\u044b\u043c\">\u041a\u0440\u044b\u043c\u0443<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a><ul><li>\u0412\u044b\u0445\u043e\u0434\u0438\u0442 \u0432 \u044d\u0444\u0438\u0440 \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%B1%D0%B8-%D1%81%D0%B8\" title=\"\u0411\u0438-\u0431\u0438-\u0441\u0438\">\u0411\u0438-\u0431\u0438-\u0441\u0438<\/a>\u00bb \u0441 \u0440\u0430\u0434\u0438\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u0438 \u00ab2LO\u00bb, \u0445\u043e\u0442\u044f \u043b\u0438\u0446\u0435\u043d\u0437\u0438\u044f \u0431\u044b\u043b\u0430 \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0430 \u0442\u043e\u043b\u044c\u043a\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/18_%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8F\" title=\"18 \u044f\u043d\u0432\u0430\u0440\u044f\">18 \u044f\u043d\u0432\u0430\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%BA%D1%81%D1%82%D0%B5,_%D0%AF%D0%BD%D0%B8%D1%81\" title=\"\u0427\u0430\u043a\u0441\u0442\u0435, \u042f\u043d\u0438\u0441\">\u042f\u043d\u0438\u0441 \u0427\u0430\u043a\u0441\u0442\u0435<\/a> \u0438\u0437\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044f I \u0421\u0435\u0439\u043c\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u0439\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a> \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0441\u0442\u0440\u0430\u043d\u044b.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u043d\u043e\u0432\u044b\u0439 \u0417\u0430\u043a\u043e\u043d \u043e \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442, \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u043f\u0430\u0440\u0442\u0438\u044f, \u043d\u0430\u0431\u0440\u0430\u0432\u0448\u0430\u044f \u043d\u0430\u0438\u0431\u043e\u043b\u044c\u0448\u0435\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0433\u043e\u043b\u043e\u0441\u043e\u0432, \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u0434\u0432\u0435 \u0442\u0440\u0435\u0442\u0438 \u043c\u0435\u0441\u0442 \u0432 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%8E%D1%80%D1%80%D0%B5%D0%B0%D0%BB%D0%B8%D0%B7%D0%BC\" title=\"\u0421\u044e\u0440\u0440\u0435\u0430\u043b\u0438\u0437\u043c\">\u0441\u044e\u0440\u0440\u0435\u0430\u043b\u0438\u0441\u0442\u043e\u0432<\/a>, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0449\u0430\u044f \u0440\u0430\u0431\u043e\u0442\u044b \u041c\u0430\u043a\u0441\u0430 \u042d\u0440\u043d\u0441\u0442\u0430, \u041c\u0430\u043d\u0430 \u0420\u044d\u044f, \u0414\u0436\u043e\u0430\u043d \u041c\u0438\u0440\u043e \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BA%D0%B0%D1%81%D1%81%D0%BE,_%D0%9F%D0%B0%D0%B1%D0%BB%D0%BE\" title=\"\u041f\u0438\u043a\u0430\u0441\u0441\u043e, \u041f\u0430\u0431\u043b\u043e\">\u041f\u0430\u0431\u043b\u043e \u041f\u0438\u043a\u0430\u0441\u0441\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u0418\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 <a href=\"htt