3e\u0440\u0433\u0438\u0435\u0432\u0438\u0447\">\u0425. \u0420\u0430\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a>&#160;\u2014 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%9A%D0%9F%D0%A1%D0%A1\" class=\"mw-redirect\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u041a\u041f\u0421\u0421\">\u0426\u041a \u0412\u041a\u041f(\u0431)<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u041d\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u0430\u044f (\u043b\u0438\u0431\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f) \u043f\u0430\u0440\u0442\u0438\u044f \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 \u0414\u0436\u043e\u0437\u0435\u0444\u043e\u043c \u0423\u043e\u0440\u0434\u043e\u043c \u0437\u0430\u0432\u043e\u0451\u0432\u044b\u0432\u0430\u0435\u0442 25 \u043c\u0435\u0441\u0442, \u0440\u0435\u0444\u043e\u0440\u043c\u0438\u0441\u0442\u044b&#160;\u2014 25 \u043c\u0435\u0441\u0442 \u0438 \u043b\u0435\u0439\u0431\u043e\u0440\u0438\u0441\u0442\u044b&#160;\u2014 19 \u043c\u0435\u0441\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u0425\u0430\u043c\u0430\u0433\u0443\u0442\u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u0435\u0442 \u043c\u043e\u043b\u043e\u0434\u043e\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0438\u0437 \u043f\u0430\u0442\u0440\u0438\u043e\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a> \u0445\u043e\u0440\u0432\u0430\u0442\u0441\u043a\u0438\u0435 \u0438 \u0441\u0435\u0440\u0431\u0441\u043a\u0438\u0435 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u044b \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0434\u0438\u043a\u0442\u0430\u0442\u043e\u0440\u0441\u043a\u0438\u0445 \u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044f \u0438 \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b\u0438 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f \u043d\u043e\u0432\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a><ul><li>\u0421\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u041f\u0435\u0440\u0432\u043e\u0435 \u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u043e\u0435 \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B