u0440\u0432\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%98%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D0%B8%D0%B8\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u0438\">\u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c \u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u0438<\/a> \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%80%D0%B8%D1%80,_%D0%A1%D1%83%D1%82%D0%B0%D0%BD\" title=\"\u0428\u0430\u0440\u0438\u0440, \u0421\u0443\u0442\u0430\u043d\">\u0421\u0443\u0442\u0430\u043d \u0428\u0430\u0440\u0438\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D1%81%D1%82%D0%B5%D1%80%D0%B4%D0%B0%D0%BC\" title=\"\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c\">\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 \u00ab\u0414\u0443\u0433\u043b\u0430\u0441 DC-3\u00bb \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00abKLM Royal Dutch Airlines\u00bb \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u0438 \u043f\u043e\u043f\u044b\u0442\u043a\u0435 \u043f\u043e\u0441\u0430\u0434\u043a\u0438 \u0432 \u043e\u0447\u0435\u043d\u044c \u043f\u043b\u043e\u0445\u0443\u044e \u043f\u043e\u0433\u043e\u0434\u0443. \u0412\u0441\u0435 26 \u043d\u0430\u0445\u043e\u0434\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%90%D1%81%D1%81%D0%B0%D0%BC%D0%B1%D0%BB%D0%B5%D1%8F_%D0%9E%D0%9E%D0%9D\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0410\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u044f \u041e\u041e\u041d\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0410\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u044f \u041e\u041e\u041d<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u0440\u0435\u0437\u043e\u043b\u044e\u0446\u0438\u044e \u0441 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043f\u0440\u043e\u0432\u0435\u0441\u0442\u0438 \u0432\u0441\u0435\u043e\u0431\u0449\u0438\u0435 \u0432\u044b\u0431\u043e\u0440\u044b \u0432\u043e \u0432\u0441\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%B5%D1%8F\" title=\"\u041a\u043e\u0440\u0435\u044f\">\u041a\u043e\u0440\u0435\u0435<\/a> \u043f\u043e\u0434 \u043d\u0430\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u0435\u043c \u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> \u043f\u043e \u041a\u043e\u0440\u0435\u0